// App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SignIn from './components/SignIn';
import SignUp from './components/SignUp';
import HospitalForm from './components/HospitalForm';
import HospitalDetail from './components/HospitalDetail';
import HospitalList from './components/HospitalList';
import Navbar from './components/Navbar';
import EditHospital from './components/EditHospital';
import BotIcon from './components/BotIcon'; // Import the BotIcon component
import './App.css';

const App = () => {
    const [isSignIn, setIsSignIn] = useState(true);

    return (
        <Router>
            <div className="App">
                <Navbar setIsSignIn={setIsSignIn} />
                <Routes>
                    <Route path="/" element={<HospitalForm />} />
                    <Route path="/hospitals" element={<HospitalList />} />
                    <Route path="/hospital/:id" element={<HospitalDetail />} />
                    <Route path="/hospital/edit/:id" element={<EditHospital />} />
                    <Route path="/signin" element={<SignIn setIsSignIn={setIsSignIn} />} />
                    <Route path="/signup" element={<SignUp setIsSignIn={setIsSignIn} />} />
                    <Route path="/about" element={<About />} />
                    <Route path="/contact" element={<Contact />} />
                </Routes>
                <BotIcon /> {/* Add the BotIcon component here */}
            </div>
        </Router>
    );
};

// About and Contact components remain unchanged

export default App;
